import React from 'react';

const num =  Math.round(Math.random()*5);


const message = () => {
	if (num < 3) {
		return 'Hello, ' + num + ' is less than 3...';
	} else {
		return 'Hello, ' + num + ' is greater than 2...';
	}
}

const Banner = (props) => {
	return (
		<div>
			<p>{
				message()
			}</p>
			<div id='banner' title='"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'></div>
		</div>
	);
}

export default Banner;
